import React, { Component } from 'react';
import './App.css';

class App extends Component {
  constructor(props){
    super(props);
    this.state = {
      data: 'Jordan Belfort',
      users: [],
    }
  }

  getData(){

    fetch('/users')
      .then(res => res.json())
      .then(users => this.setState({ users }));
  }

  componentDidMount(){
    this.getData();
  }

  render() {
    return(
      <div>
      {this.state.data}
    </div>
    )
  }
}

export default App;
